import React from 'react';

class AddBurgerForm extends React.Component {
	render() {
		return (
		<form className='burger-edit'>
			<input 
			name='name' 
			type='text' 
			placeholder='Name' 
			autoComplete='off' 
			/>
			<input 
			name='price' 
			type='text' 
			placeholder='Price' 
			autoComplete='off' 
			/>
			<select 
			name='status' 
			className='status' 
			/>
			<input name='desc' type='text' placeholder='Description' autoComplete='off' />
			<input name='image' type='text' placeholder='Image' autoComplete='off' />
		</form>
		);
	}
}

export default AddBurgerForm;
